import React, { useState } from 'react';
import { Parallax } from 'react-parallax';
import Video from '../../videos/video.mp4';
import GradPhoto from '../../images/MyPhoto.JPG';
import AwardPhoto from '../../images/Award.png';
import EducationPhoto from '../../images/Education.png'
import {
  HomeContainer,
  HomeWrapper,
  HomeBg,
  HomeVideoBg,
  Home,
  HomeLeftPhotoCard,
  HomePhotoIcon,
  HomeAwardIcon,
  HomeRight,
  HomeEducationIcon,
  HomeEducationCard,
  HomeAwardCard,
  HomeH1,
  HomeH2,
  HomeH4
} from './HomeElements';

function HomeSection() {
  const [hover, setHover] = useState(false);

  const onHover = () => {
    setHover(!hover);
  };

  const Container = () => (
    <Parallax
        blur={{ min: -15, max: 15 }}
        bgImage={require('../../images/BackgroundPara.jpg')}
        bgImageAlt="the dog"
        strength={-200}
    >
        Blur transition from min to max
        <div style={{ height: '200px' }} />
    </Parallax>
);
  return (
    <HomeContainer id='Home'>
      <HomeBg>
        <HomeVideoBg playsInline autoPlay loop muted src={Video} type='video/mp4' />
      </HomeBg>
      <HomeWrapper>
        <Home>
          <HomeLeftPhotoCard>
            <HomePhotoIcon src={GradPhoto}></HomePhotoIcon>
            <HomeH1>Isse H Nur</HomeH1>
          </HomeLeftPhotoCard>
          <HomeRight>
            <HomeEducationCard>
              <HomeH2>Education</HomeH2>
              <HomeEducationIcon src={EducationPhoto}></HomeEducationIcon>
              <HomeH4>Degree: BS in Computer Science</HomeH4>
              <HomeH4>Date Graduated: December 15 2020</HomeH4>
            </HomeEducationCard>
            <HomeAwardCard>
              <HomeH2>Awards</HomeH2>
              <HomeAwardIcon src={AwardPhoto}></HomeAwardIcon>
              <HomeH4>Phi Theta Kappa Honors Society</HomeH4>
            </HomeAwardCard>
          </HomeRight>
        </Home>
      </HomeWrapper>
    </HomeContainer>
  );
}

export default HomeSection;
